describe("Element Data Attributes Tests",function(){var b;it("reads the 'data-slider-min' property and sets it on slider",function(){b=$("#minSlider").slider();b.slider("setValue",1);var a=b.slider("getValue");expect(a).toBe(5)});it("reads the 'data-slider-max' property and sets it on slider",function(){b=$("#maxSlider").slider();b.slider("setValue",10);var a=b.slider("getValue");expect(a).toBe(5)});it("reads the 'data-slider-step' property and sets it on slider",function(){b=$("#stepSlider").slider();expect(true).toBeTruthy()});it("reads the 'data-slider-precision' property (which is set to 2) and sets it on slider",function(){b=$("#precisionSlider").slider();b.slider("setValue",8.115);var a=b.slider("getValue");expect(a).toBe(8.12)});it("reads the 'data-slider-orientation' property and sets it on slider",function(){b=$("#orientationSlider").slider();var a=$("#orientationSlider").parent("div.slider").hasClass("slider-vertical");expect(a).toBeTruthy()});it("reads the 'data-slider-value' property and sets it on slider",function(){b=$("#valueSlider").slider();var a=b.slider("getValue");expect(a).toBe(5)});it("reads the 'data-slider-selection' property and sets it on slider",function(){b=$("#selectionSlider").slider();b.slider("setValue",10);var a=$("#selectionSlider").siblings("div.slider-track").children("div.slider-selection").width();expect(a).toBe(0)});it("reads the 'data-slider-tooltip' property and sets it on slider",function(){b=$("#tooltipSlider").slider();var a=$("#tooltipSlider").siblings("div.tooltip").hasClass("hide");expect(a).toBeTruthy()});it("reads the 'data-slider-handle' property and sets it on slider",function(){b=$("#handleSlider").slider();var d=$("#handleSlider").siblings("div.slider-track").children("div.slider-handle").hasClass("triangle");expect(d).toBeTruthy();b=$("#customHandleSlider").slider();var a=$("#customHandleSlider").siblings("div.slider-track").children("div.slider-handle").hasClass("custom");expect(a).toBeTruthy()});it("reads the 'data-slider-reversed' property and sets it on slider",function(){b=$("#reversedSlider").slider();b.slider("setValue",10);var a=$("#reversedSlider").siblings("div.slider-track").children("div.slider-selection").width();expect(a).toBe(0)});it("reads the 'data-slider-enabled' property and sets it on slider",function(){b=$("#disabledSlider").slider();var a=b.slider("isEnabled");expect(a).not.toBeTruthy()});it("changes the 'data-slider-orientation' property from horizontal to vertical",function(){b=$("#changeOrientationSlider").slider();b.slider("setAttribute","orientation","vertical").slider("refresh");var e=$("#changeOrientationSlider").parent("div.slider");var f=e.hasClass("slider-vertical");var a=e.find(".slider-handle").last().hasClass("hide");expect(f).toBeTruthy();expect(a).toBeTruthy()});afterEach(function(){if(b){b.slider("destroy")}})});